import React, { useState } from "react";
import "./ToggleButton.scss";



const ToggleButton = ({ title }) => {
    const [color, setColor] = useState(true);


    function toggle() {
        setColor(!color);
    }

    return (
        <button className="toggleButton" >{title}</button>
    )
}

export default ToggleButton;
